import React from 'react';
import { useLocation } from 'react-router-dom';
import { TrendingUp, BarChart2, Briefcase, ArrowUp, ArrowDown } from 'lucide-react';
import './ResultPage.css';

function ResultPage() {
  const { state } = useLocation();
  const { data } = state || {};

  if (!data) {
    return (
      <div className="result-page">
        <div className="result-container error">
          <h1>No Data Available</h1>
          <p>Please return to the previous page and submit your investment preferences.</p>
        </div>
      </div>
    );
  }

  const formatCurrency = (value) => {
    return new Intl.NumberFormat('en-US', {
      style: 'currency',
      currency: 'USD',
    }).format(value);
  };

  const formatPercentage = (value) => {
    return `${(value * 100).toFixed(2)}%`;
  };

  // Ensure we have valid data structures
  const allocation = data.allocation || {};
  const marketEvaluation = data.market_evaluation || {};
  const selectedAssets = Array.isArray(data.selected_assets) 
    ? data.selected_assets 
    : [data.selected_assets].filter(Boolean);

  return (
    <div className="result-page">
      <div className="result-container">
        <div className="result-header">
          <h1>Investment Strategy</h1>
          <p className="result-subtitle">Personalized Portfolio Analysis</p>
        </div>

        <div className="results-grid">
          <div className="result-section">
            <div className="section-header">
              <TrendingUp size={24} />
              <h2>Portfolio Allocation</h2>
            </div>
            <div className="allocation-grid">
              {Object.entries(allocation).map(([asset, percentage]) => (
                <div key={asset} className="allocation-item">
                  <div className="allocation-info">
                    <span className="asset-name">{asset}</span>
                    <span className="asset-percentage">{formatPercentage(percentage)}</span>
                  </div>
                  <div className="allocation-bar">
                    <div 
                      className="allocation-fill" 
                      style={{ width: `${percentage * 100}%` }}
                    ></div>
                  </div>
                </div>
              ))}
            </div>
          </div>

          <div className="result-section">
            <div className="section-header">
              <BarChart2 size={24} />
              <h2>Market Evaluation</h2>
            </div>
            <div className="market-metrics">
              {Object.entries(marketEvaluation).map(([metric, value]) => (
                <div key={metric} className="metric-card">
                  <span className="metric-name">{metric.replace(/_/g, ' ')}</span>
                  <span className="metric-value">
                    {typeof value === 'number' && (
                      value > 0 ? <ArrowUp className="trend-up" /> : <ArrowDown className="trend-down" />
                    )}
                    {typeof value === 'number' 
                      ? (value > 1 ? formatCurrency(value) : formatPercentage(value))
                      : value}
                  </span>
                </div>
              ))}
            </div>
          </div>

          <div className="result-section">
            <div className="section-header">
              <Briefcase size={24} />
              <h2>Recommended Assets</h2>
            </div>
            <div className="assets-grid">
              {selectedAssets.map((asset, index) => (
                <div key={index} className="asset-card">
                  <div className="asset-header">
                    <span className="asset-title">
                      {typeof asset === 'object' ? asset.name : asset}
                    </span>
                    {typeof asset === 'object' && asset.type && (
                      <span className="asset-type">{asset.type}</span>
                    )}
                  </div>
                  {typeof asset === 'object' && asset.description && (
                    <p className="asset-description">{asset.description}</p>
                  )}
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default ResultPage;
